/* used to remove borders from tables and images */
.borderless, table.borderless td, table.borderless th {
  border: 0 }

  padding: 0 0.5em 0 0 ! important }

.first {

  margin-top: 0 ! important }

.last, .with-subtitle {

.hidden {

.subscript {

dl.docutils dd {

dl.docutils dt {

div.abstract {
